import React from 'react';
import './ActorRender.scss'
import ActorTag from './ActorTag';

function ActorRender(props) {
    const renderActor = () =>{
        let actors = []
        for(let i =0 ; i < 24 ;i++) {
            actors.push(props[i])
        }
       return  actors.map(el => {
            return <ActorTag info={el} /> 
        })
    }

    return (
        <div className="actor-container">
           {renderActor()}
        </div>
    );
}

export default ActorRender;
